Here is an example of how you can create a custom token for a guest user in Laravel:
use Firebase\JWT\JWT;
$uid = 'guest-' . uniqid();
$customToken = JWT::encode([
    'uid' => $uid,
    'iat' => time(),
    'exp' => time() + 3600,
], 'your-firebase-secret');
In this example, we are creating a unique user ID for the guest user by concatenating the string "guest-" with a unique ID generated using the uniqid() function. We are then creating a custom token using the Firebase JWT library and encoding the user ID, the current time, and an expiration time of one hour.
Once you have created the custom token, you can use it to authenticate the guest user with Firebase. Here is an example of how you can do this in Laravel:
use Firebase\Firebase;
$firebase = new Firebase('https://your-firebase-project.firebaseio.com', 'your-firebase-secret');
$firebase->auth()->signInWithCustomToken($customToken);
In this example, we are creating a new Firebase instance and signing in with the custom token we created earlier. This will authenticate the guest user with Firebase and allow them to use the chat feature.
